[素材]<br>
アッパー素材：PU×革<BR>
底素材：ラバー×EVA底<BR>
<HR>
[特徴]<br>
ミリタリーをカモフラで表現するのではなく、薬莢ベルトで表現したヒップホップダンスシューズ。<br>
スニーカーの秩序や概念を崩し、破壊して再構築させたスニーカー。<br>
つま先にはランニングシューズ風ディティールを組み込ませ、パンツの裾で足首部分が隠れた時にランシングシューズに見えるギミック的なデザイン。<br>
BLACは、派手になりすぎないラスタカラー。<br>
GRYCは、オレンジが冴えわたるミリタリーテイストカラー。<HR>
＊足幅細めのため、普段のサイズより0.5cm上をおすすめします。<HR>
【あす楽対応は北海道のみです】<BR>
